Telling, The (2009)  

Verenigde Staten
Horror
84 minuten

geregisseerd door Nicholas Carpenter en Casey Ward
met Bridget Marquardt, Holly Madison en Jean Louise O'Sullivan

Drie meisjes willen zich verbinden aan de populairste (en meeste wrede) studentenvereniging van de school. Als laatste opdracht moeten ze het engste verhaal vertellen dat ze kennen. Ze vertellen ieder afzonderlijk een verhaal. Deze verhalen inspireren iemand van de vereniging om zelf te gaan moorden.


